import React from 'react'
import styled from 'styled-components'

const FrameCard = styled.div`
  width: 27%;
  display: flex;
  flex-wrap: wrap;
  flex-direction: column;
  padding: 1.5em;
  background-color: red; 
  padding-top: 2em;
  margin-top: 2.3em;

  p{
    font-weight: 300;
    font-size: .86em;
  }
`

const Image = styled.img`
  width: 15%;
`

const Title = styled.h3`
  font-size: 1.5em;
  margin: 0;
  padding: 0;
  margin-top: 1.5em;
  font-family: Ruberoid;
`

function BuildCard({framework}) {
  return (
    <FrameCard>
        <Image src={framework.logo} alt={framework.title}/>
        <Title>{framework.title}</Title>
        <p>{framework.sub}</p>
        {framework.button.length === 0 && <button>Coming soon</button>}
        {framework.button && framework.button.map((button) => {
            return(<button>{button}</button>)
        })}
    </FrameCard>
  )
}

export default BuildCard
